function handleFileSelect(n){var u=n.target.files,i,t,r;for(document.getElementById("list").innerHTML="",i=0;t=u[i];i++)t.type.match("image.*")&&(r=new FileReader,r.onload=function(n){return function(t){var i=document.createElement("span");i.innerHTML=['<img class="thumb" src="',t.target.result,'" title="',escape(n.name),'"/>'].join("");document.getElementById("list").insertBefore(i,null)}}(t),r.readAsDataURL(t))}function handleFileSelect_plan(n){var u=n.target.files,i,t,r;for(document.getElementById("list_plan").innerHTML="",i=0;t=u[i];i++)t.type.match("image.*")&&(r=new FileReader,r.onload=function(n){return function(t){var i=document.createElement("span");i.innerHTML=['<img class="thumb" src="',t.target.result,'" title="',escape(n.name),'"/>'].join("");document.getElementById("list_plan").insertBefore(i,null)}}(t),r.readAsDataURL(t))}document.getElementById("files").addEventListener("change",handleFileSelect,!1);document.getElementById("files_plan").addEventListener("change",handleFileSelect_plan,!1);